import './HomePage.scss';

function HomePage() {
    return (
        <nav>
            <div>Laurie Villeton</div>
            <ul>
                <li>Projects</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}

export default HomePage;
